<!DOCTYPE html>
<html lang="pt-BR">
<head>
  <meta charset="UTF-8">
  <title>Aniversariantes IEQ Bela Vista</title>
  <style>
    body {
      font-family: Arial, sans-serif;
      padding: 20px;
    }

    h2 {
      text-align: center;
      margin-bottom: 30px;
    }

    table {
      border-collapse: collapse;
      width: 100%;
      max-width: 1000px;
      margin: 0 auto;
    }

    th, td {
      border: 1px solid #ccc;
      padding: 8px 12px;
      text-align: left;
    }

    th {
      background-color: #f2f2f2;
      cursor: pointer;
      user-select: none;
    }

    th:hover {
      background-color: #e2e2e2;
    }

    td img {
      width: 100px;
      height: 100px;
      object-fit: cover;
      border-radius: 8px;
      cursor: pointer;
      transition: transform 0.2s;
    }

    td img:hover {
      transform: scale(1.05);
    }

    /* Modal */
    .modal {
      display: none;
      position: fixed;
      z-index: 999;
      left: 0;
      top: 0;
      width: 100vw;
      height: 100vh;
      background-color: rgba(0,0,0,0.95);
      justify-content: center;
      align-items: center;
    }

    .modal-content {
      position: relative;
      width: 100vw;
      height: 100vh;
      display: flex;
      justify-content: center;
      align-items: center;
    }

    .modal-content img {
      max-width: 100%;
      max-height: 100%;
      width: auto;
      height: auto;
      object-fit: contain;
    }

    .close-btn {
      position: absolute;
      top: 20px;
      right: 30px;
      font-size: 30px;
      background: #ff4d4d;
      color: white;
      border: none;
      border-radius: 50%;
      width: 40px;
      height: 40px;
      cursor: pointer;
      z-index: 1000;
    }
  </style>
</head>
<body>
  <h2>Aniversariantes IEQ Bela Vista</h2>

  <table>

      <tr>

        <th onclick="ordenarTabela('dias')">Dias para Aniversário</th>

    <tbody id="tabela-corpo">

    </div>
  </div>

    let ordemAtual = {
      campo: null,
      crescente: true
    };

    function diasParaAniversario(dataNascimento) {
      const hoje = new Date();
      const nascimento = new Date(dataNascimento);
      const anoAtual = hoje.getFullYear();

      let proximoAniversario = new Date(anoAtual, nascimento.getMonth(), nascimento.getDate());
      if (proximoAniversario < hoje) {
        proximoAniversario.setFullYear(anoAtual + 1);
      }

      const diffEmMs = proximoAniversario - hoje;
      return Math.ceil(diffEmMs / (1000 * 60 * 60 * 24));
    }

    function obterPessoasComDias() {
      return pessoas.map(pessoa => ({
        ...pessoa,
        dias: diasParaAniversario(pessoa.nascimento)
      }));
    }

    function ordenarTabela(campo) {
      const corpoTabela = document.getElementById("tabela-corpo");
      let pessoasComDias = obterPessoasComDias();

      if (ordemAtual.campo === campo) {
        ordemAtual.crescente = !ordemAtual.crescente;
      } else {
        ordemAtual.campo = campo;
        ordemAtual.crescente = true;
      }

      pessoasComDias.sort((a, b) => {
        let valorA = a[campo];
        let valorB = b[campo];

        if (campo === "nascimento") {
          valorA = new Date(valorA).getTime();
          valorB = new Date(valorB).getTime();
        }

        if (typeof valorA === 'string') {
          valorA = valorA.toLowerCase();
          valorB = valorB.toLowerCase();
        }

        if (valorA < valorB) return ordemAtual.crescente ? -1 : 1;
        if (valorA > valorB) return ordemAtual.crescente ? 1 : -1;
        return 0;
      });

      corpoTabela.innerHTML = "";
      pessoasComDias.forEach(pessoa => {
        const tr = document.createElement("tr");
        tr.innerHTML = `
          <td>${pessoa.id}</td>
          <td>${pessoa.nome}</td>
          <td>${new Date(pessoa.nascimento).toLocaleDateString("pt-BR")}</td>
          <td>${pessoa.dias}</td>
          <td><img src="${pessoa.foto}" alt="Foto de ${pessoa.nome}" onclick="abrirModal('${pessoa.foto}')"></td>
        `;
        corpoTabela.appendChild(tr);
      });
    }

    function abrirModal(url) {
      document.getElementById("modal-img").src = url;
      document.getElementById("modal").style.display = "flex";
    }

    function fecharModal() {
      document.getElementById("modal").style.display = "none";
      document.getElementById("modal-img").src = "";
    }

    window.addEventListener("click", function(e) {
      const modal = document.getElementById("modal");
      if (e.target === modal) {
        fecharModal();
      }
    });

    // Inicializa com ordenação por dias
    ordenarTabela("dias");

function converterParaBase64(event) {
    const file = event.target.files[0];
    const reader = new FileReader();

    reader.onload = function(e) {
      document.getElementById("preview").src = e.target.result;
      console.log("Base64:", e.target.result); // Aqui você vê o hash no console
    };

    if (file) {
      reader.readAsDataURL(file);
    }
  }
  </script>
